DECLARE @UserOrganizationDetailsMappingImport
 TABLE (
 UserOrganizationDetailMappingID bigint NULL,
 UserGUID varchar(32) NULL,
 MappingID bigint NULL,
 IsActive bigint NULL,
 ModifiedOn datetime NULL,
 ModifiedBy bigint NULL,
 CreatedOn datetime NULL,
 CreatedBy bigint NULL,
 SystemCreatedOn datetime NULL,
 SystemModifiedOn datetime NULL
)

	[UserID], 
	[MappingID], 
	[IsActive], 
	[ModifiedBy], 
	[ModifiedOn]
)
SELECT 
	[UserID], 
	[MappingID], 
	IT.[IsActive], 
	1 AS ModifiedBy, 
	GETUTCDATE() AS ModifiedOn
FROM [Core].[Users] AT INNER JOIN @UserOrganizationDetailsMappingImport IT ON AT.UserGUID = IT.UserGUID

